import SearchBox from "./Components/SearchBox";
import "./style.css";

export default function Search() { 
    const handleSearchClick = () => {};
    const handleCloseCLick = () => {};  
    return (
        <div className="search">
            <SearchBox onSearch={handleSearchClick} onClose={handleCloseCLick}/>
        </div>
    );
}
